itemtype:"method",name:"background",chainable:1,example:["\n\x3cdiv\x3e\n\x3ccode\x3e\n// Grayscale integer value\nbackground(51);\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// R, G \x26 B integer values\nbackground(255, 204, 0);\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// H, S \x26 B integer values\ncolorMode(HSB);\nbackground(255, 204, 100);\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// Named SVG/CSS color string\nbackground('red');\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// three-digit hexadecimal RGB notation\nbackground('#fae');\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// six-digit hexadecimal RGB notation\nbackground('#222222');\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// integer RGB notation\nbackground('rgb(0,255,0)');\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// integer RGBA notation\nbackground('rgba(0,255,0, 0.25)');\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// percentage RGB notation\nbackground('rgb(100%,0%,10%)');\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// percentage RGBA notation\nbackground('rgba(100%,0%,100%,0.5)');\n\x3c/code\x3e\n\x3c/div\x3e\n\n\x3cdiv\x3e\n\x3ccode\x3e\n// p5 Color object\nbackground(color(0, 0, 255));\n\x3c/code\x3e\n\x3c/div\x3e"],
