itemtype:"method",name:"deviceTurned",example:["\n\x3cdiv class\x3d\"norender\"\x3e\n\x3ccode\x3e\n// Run this example on a mobile device\n// Rotate the device by 90 degrees\n// to change the value.\n\nlet value \x3d 0;\nfunction draw() {\n  fill(value);\n  rect(25, 25, 50, 50);\n}\nfunction deviceTurned() {\n  if (value \x3d\x3d\x3d 0) {\n    value \x3d 255;\n  } else if (value \x3d\x3d\x3d 255) {\n    value \x3d 0;\n  }\n}\n\x3c/code\x3e\n\x3c/div\x3e\n\x3cdiv\x3e\n\x3ccode\x3e\n// Run this example on a mobile device\n// Rotate the device by 90 degrees in the\n// X-axis to change the value.\n\nlet value \x3d 0;\nfunction draw() {\n  fill(value);\n  rect(25, 25, 50, 50);\n}\nfunction deviceTurned() {\n  if (turnAxis \x3d\x3d\x3d 'X') {\n    if (value \x3d\x3d\x3d 0) {\n      value \x3d 255;\n    } else if (value \x3d\x3d\x3d 255) {\n      value \x3d 0;\n    }\n  }\n}\n\x3c/code\x3e\n\x3c/div\x3e"],
