itemtype:"method",name:"keyIsDown",params:[{name:"code",description:"\x3cp\x3eThe key to check for.\x3c/p\x3e\n",type:"Number"}],return:{description:"whether key is down or not",type:"Boolean"},example:['\n\x3cdiv\x3e\x3ccode\x3e\nlet x \x3d 100;\nlet y \x3d 100;\n\nfunction setup() {\n  createCanvas(512, 512);\n  fill(255, 0, 0);\n}\n\nfunction draw() {\n  if (keyIsDown(LEFT_ARROW)) {\n    x -\x3d 5;\n  }\n\n  if (keyIsDown(RIGHT_ARROW)) {\n    x +\x3d 5;\n  }\n\n  if (keyIsDown(UP_ARROW)) {\n    y -\x3d 5;\n  }\n\n  if (keyIsDown(DOWN_ARROW)) {\n    y +\x3d 5;\n  }\n\n  clear();\n  ellipse(x, y, 50, 50);\n}\n\x3c/code\x3e\x3c/div\x3e\n\n\x3cdiv\x3e\x3ccode\x3e\nlet diameter \x3d 50;\n\nfunction setup() {\n  createCanvas(512, 512);\n}\n\nfunction draw() {\n  // 107 and 187 are keyCodes for "+"\n  if (keyIsDown(107) || keyIsDown(187)) {\n    diameter +\x3d 1;\n  }\n\n  // 109 and 189 are keyCodes for "-"\n  if (keyIsDown(109) || keyIsDown(189)) {\n    diameter -\x3d 1;\n  }\n\n  clear();\n  fill(255, 0, 0);\n  ellipse(50, 50, diameter, diameter);\n}\n\x3c/code\x3e\x3c/div\x3e'],
