itemtype:"property",name:"pixels",type:"Number[]",example:["\n\x3cdiv\x3e\n\x3ccode\x3e\nlet img \x3d createImage(66, 66);\nimg.loadPixels();\nfor (let i \x3d 0; i \x3c img.width; i++) {\n  for (let j \x3d 0; j \x3c img.height; j++) {\n    img.set(i, j, color(0, 90, 102));\n  }\n}\nimg.updatePixels();\nimage(img, 17, 17);\n\x3c/code\x3e\n\x3c/div\x3e\n\x3cdiv\x3e\n\x3ccode\x3e\nlet pink \x3d color(255, 102, 204);\nlet img \x3d createImage(66, 66);\nimg.loadPixels();\nfor (let i \x3d 0; i \x3c 4 * (width * height / 2); i +\x3d 4) {\n  img.pixels[i] \x3d red(pink);\n  img.pixels[i + 1] \x3d green(pink);\n  img.pixels[i + 2] \x3d blue(pink);\n  img.pixels[i + 3] \x3d alpha(pink);\n}\nimg.updatePixels();\nimage(img, 17, 17);\n\x3c/code\x3e\n\x3c/div\x3e"],
