itemtype:"method",name:"loadJSON",return:{description:"JSON data",type:"Object|Array"},example:["\n\n\x3cp\x3eCalling \x3ca href\x3d\"#/p5/loadJSON\"\x3eloadJSON()\x3c/a\x3e inside \x3ca href\x3d\"#/p5/preload\"\x3epreload()\x3c/a\x3e guarantees to complete the\noperation before \x3ca href\x3d\"#/p5/setup\"\x3esetup()\x3c/a\x3e and \x3ca href\x3d\"#/p5/draw\"\x3edraw()\x3c/a\x3e are called.\x3c/p\x3e\n\n\x3cdiv\x3e\x3ccode\x3e\n// Examples use USGS Earthquake API:\n//   https://earthquake.usgs.gov/fdsnws/event/1/#methods\nlet earthquakes;\nfunction preload() {\n  // Get the most recent earthquake in the database\n  let url \x3d\n   'https://earthquake.usgs.gov/earthquakes/feed/v1.0/' +\n    'summary/all_day.geojson';\n  earthquakes \x3d loadJSON(url);\n}\n\nfunction setup() {\n  noLoop();\n}\n\nfunction draw() {\n  background(200);\n  // Get the magnitude and name of the earthquake out of the loaded JSON\n  let earthquakeMag \x3d earthquakes.features[0].properties.mag;\n  let earthquakeName \x3d earthquakes.features[0].properties.place;\n  ellipse(width / 2, height / 2, earthquakeMag * 10, earthquakeMag * 10);\n  textAlign(CENTER);\n  text(earthquakeName, 0, height - 30, width, 30);\n}\n\x3c/code\x3e\x3c/div\x3e\n\n\n\x3cp\x3eOutside of preload(), you may supply a callback function to handle the\nobject:\x3c/p\x3e\n\x3cdiv\x3e\x3ccode\x3e\nfunction setup() {\n  noLoop();\n  let url \x3d\n   'https://earthquake.usgs.gov/earthquakes/feed/v1.0/' +\n    'summary/all_day.geojson';\n  loadJSON(url, drawEarthquake);\n}\n\nfunction draw() {\n  background(200);\n}\n\nfunction drawEarthquake(earthquakes) {\n  // Get the magnitude and name of the earthquake out of the loaded JSON\n  let earthquakeMag \x3d earthquakes.features[0].properties.mag;\n  let earthquakeName \x3d earthquakes.features[0].properties.place;\n  ellipse(width / 2, height / 2, earthquakeMag * 10, earthquakeMag * 10);\n  textAlign(CENTER);\n  text(earthquakeName, 0, height - 30, width, 30);\n}\n\x3c/code\x3e\x3c/div\x3e"],
