line:751,description:"\x3cp\x3eMove camera along its local axes while maintaining current camera orientation.\x3c/p\x3e\n",itemtype:"method",name:"move",params:[{name:"x",description:"\x3cp\x3eamount to move along camera\x26#39;s left-right axis\x3c/p\x3e\n",type:"Number"},{name:"y",description:"\x3cp\x3eamount to move along camera\x26#39;s up-down axis\x3c/p\x3e\n",type:"Number"},{name:"z",description:"\x3cp\x3eamount to move along camera\x26#39;s forward-backward axis\x3c/p\x3e\n",type:"Number"}],
